<script setup>
import { onLaunch } from "@dcloudio/uni-app"
import api from "./lib/api-client"
import { ACCESS_TOKEN_KEY, ACCOUNT_INFO_KEY } from "./lib"

onLaunch(() => {
    const token = uni.getStorageSync(ACCESS_TOKEN_KEY)

    // 如果token存在，则直接跳转
    if (token) {
        api.GET("/api/wx/getUserInfo").then(resp => {
            uni.setStorageSync(ACCOUNT_INFO_KEY, resp.data)
        })
        return
    }

    uni.login({
        provider: 'weixin',
        success: async (resp) => {
            const tokenResp = await api.POST("/api/wx/login", {
                code: resp.code
            })
            uni.setStorageSync(ACCESS_TOKEN_KEY, tokenResp.data)

            const userInfoResp = await api.GET("/api/wx/getUserInfo")
            uni.setStorageSync(ACCOUNT_INFO_KEY, userInfoResp.data)
        }
    })
})
</script>

